import styled, { css } from 'styled-components'


export const Container = styled.div`
  display: flex;
  width: 100vw;
  height: 100vh;
  background: #282c34;
  overflow: hidden;

  .image{
    img{
      height: 100vh;
    }
  }

  .wrapper{
    width: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;

    .logo{
      height: 300px;
    }

    .name{
      height: 500px;
    }

    img{
      margin-top: 20px;
    };
  }

`
